import React from 'react'
import {Link} from "react-router-dom";
import '../../css/HomePage.css';

const HomePage = ({socket}) => {
  return (
    <div className="HomePage">
      <h1> HOMEPAGE </h1>


      
      <Link to='/lobby'> Create Room </Link>


    </div>

  )
}

export default HomePage
